import { constants, ethers } from "ethers";
import Conabi from "../abi/SimpleCounter.json";
import Conadd from "../abi/ContractAddress.json";
import { useState, useEffect } from "react";

const contractAbi = Conabi.abi;
const contractAddress = Conadd.address;

const ContractPage = ({ AccAddress, AccBalance }) => {

  // useEffect(() => {

  //   const storeAccounts = async () => {
  //     const response = await fetch("/userWallets", {
  //       method: "POST",
  //       headers: {
  //         "Content-type": "application/json"
  //       },
  //       body: JSON.stringify({ Address: AccAddress, Balance: AccBalance })
  //     })
  //     const result = await response.json();

  //     console.log(result);
  //   }

  //   storeAccounts();
  // });

  const [updateCounter, setUpdateCounter] = useState();
  const [fetchedValue, setFetchedValue] = useState();
  const [ContractCalled, setContractCalled] = useState();
  const [otherSelected, setOtherSeleceted] = useState(false);

  const ContractAccess = () => {
    const provider = new ethers.providers.Web3Provider(window.ethereum);
    const signer = provider.getSigner()
    const Contract = new ethers.Contract(contractAddress, contractAbi, signer);

    return Contract;
  }

  const FilledForm = async (event) => {

    event.preventDefault();

    console.log(fetchedValue);

    setContractCalled(false);

    const Contract = ContractAccess();

    await Contract.setCounter(fetchedValue);

    console.log("I have waited here for the Confirmation");

    // const counterUpdate = await Contract.getCount();

    // console.log(counterUpdate);

    // const value = ethers.utils.arrayify(counterUpdate);

    // console.log(value[0]);

    // setUpdateCounter(value[0]);

    setUpdateCounter(parseInt(fetchedValue));

    setContractCalled(true);
  }

  // const Increment = async () => {

  //   const Contract = ContractAccess();

  //   await Contract.incrementCounter();
  //   const counterUpdate = await Contract.getCount();

  //   console.log("Contract Get Fucntion Result : ", counterUpdate);

  //   const value = ethers.utils.arrayify(counterUpdate);

  //   console.log("Value Got : ", value[0]);

  //   setUpdateCounter(value[0]);
  // }

  // const Decrement = async () => {

  //   const Contract = ContractAccess();

  //   await Contract.decrementCounter();
  //   const counterUpdate = await Contract.getCount();

  //   console.log("Contract Get Fucntion Result : ", counterUpdate);

  //   const value = ethers.utils.arrayify(counterUpdate);

  //   console.log("Value Got : ", value[0]);

  //   setUpdateCounter(value[0]);
  // }

  // return (
  //   <div>
  //     <form onSubmit={SetCounter}>
  //       <label>Set Counter Value
  //         <br />
  //         <input
  //           value={fetchedValue}
  //           onChange={(e) => { setFetchedValue(e.target.value) }}
  //           required
  //         >
  //         </input>
  //       </label>
  //       <br />
  //       <button type="submit">Set Counter</button>
  //     </form>
  //     <div>
  //       <button onClick={() => { setUpdateCounter(updateCounter + 1) }}>+</button>
  //       {/* <button onClick={Increment}>+</button> */}
  //       {ContractCalled ? <h2>{updateCounter}</h2> : ''}
  //       <button onClick={() => { setUpdateCounter(updateCounter - 1) }}>-</button>
  //       {/* <button onClick={Decrement}>-</button> */}
  //     </div>
  //   </div>
  // )
  return (
    <div className="flex min-h-full items-center justify-center py-12 px-4 sm:px-6 lg:px-8">
      <div className="w-full max-w-md space-y-8">
        <div>
          <img
            className="mx-auto h-21 w-auto"
            // src="https://tailwindui.com/img/logos/mark.svg?color=indigo&shade=600"
            src="data:image/png;base64,"
            alt="Your Company"
          />
          <h2 className="text-center text-3xl font-bold tracking-tight text-red-500">
            Book an Appointment
          </h2>
        </div>
        <form className="mt-8 space-y-6" onSubmit={FilledForm}>
          {/* <input type="hidden" name="remember" defaultValue="true" /> */}
          <div className="-space-y-px rounded-md shadow-sm">
            <div>
              {/* htmlFor="password" className="sr-only" */}
              <label>
                Name
              </label>
              <input
                id="name"
                name="name"
                type="name"
                required
                className="mt-2 relative block w-full appearance-none rounded-none rounded-t-md border border-gray-300 px-3 py-2 text-gray-900 placeholder-gray-500 focus:z-10 focus:border-indigo-500 focus:outline-none focus:ring-indigo-500 sm:text-sm"
                placeholder="Full Name"
              />
            </div>
            <br />
            <div>
              <label>
                CNIC Number
              </label>
              <input
                id="cnicNumber"
                name="cnicNumber"
                type="tel"
                pattern="[0-9]{5}-[0-9]{7}-[0-9]{1}"
                required
                className="mt-2 relative block w-full appearance-none rounded-none rounded-b-md border border-gray-300 px-3 py-2 text-gray-900 placeholder-gray-500 focus:z-10 focus:border-indigo-500 focus:outline-none focus:ring-indigo-500 sm:text-sm"
                placeholder="35202 - 58XXXXXX - X"
              />
            </div>
            <br />
            <div>
              <label>
                Contact Number
              </label>
              <input
                id="contact"
                name="contact"
                type="tel"
                pattern="[0-9]{4}-[0-9]{7}"
                required
                className="mt-2 relative block w-full appearance-none rounded-none rounded-b-md border border-gray-300 px-3 py-2 text-gray-900 placeholder-gray-500 focus:z-10 focus:border-indigo-500 focus:outline-none focus:ring-indigo-500 sm:text-sm"
                placeholder="0349 - 52XXXXX"
              />
            </div>
            <br />
            <div>
              <label>
                Address
              </label>
              <input
                id="address"
                name="address"
                type="text"
                required
                className="mt-2 relative block w-full appearance-none rounded-none rounded-b-md border border-gray-300 px-3 py-2 text-gray-900 placeholder-gray-500 focus:z-10 focus:border-indigo-500 focus:outline-none focus:ring-indigo-500 sm:text-sm"
                placeholder="House No 4##, Block J-#, Johar Town, Lahore"
              />
            </div>
            <br />
            <div>
              <label>
                Appoitnment Type
              </label>
              <select
                id="appointment"
                name="appointment"
                className="mt-2 relative block w-full appearance-none rounded-none rounded-b-md border border-gray-300 px-3 py-2 text-gray-900 placeholder-grey-500 focus:z-10 focus:border-indigo-500 focus:outline-none focus:ring-indigo-500 sm:text-sm"
                required>
                <option onClick={() => { setOtherSeleceted(false) }}>General Checkup</option>
                <option onClick={() => { setOtherSeleceted(false) }}>Specialist Consultation</option>
                <option onClick={() => { setOtherSeleceted(false) }}>Peed's Services</option>
                <option onClick={() => { setOtherSeleceted(false) }}>Gynecology</option>
                <option onClick={() => { setOtherSeleceted(true) }}>Others...</option>
              </select>
            </div>
            {otherSelected &&
              <>
                <br />
                <div>
                  <label>
                    Describe
                  </label>
                  <br/>
                  <textarea className="border border-gray-300" rows="5" cols="50">
                    Yello
                  </textarea>
                </div>
              </>
            }
          </div>
          <div>
            <br />
            <button
              type="submit"
              className="group relative flex w-full justify-center rounded-md border border-transparent bg-indigo-400 py-2 px-4 text-sm font-large text-white hover:bg-indigo-500 focus:outline-none focus:ring-2 focus:ring-indigo-500 focus:ring-offset-2">
              Register
            </button>
          </div>
        </form>
      </div>
    </div>
  )
}

export default ContractPage
